export const onAdvanceSerach = queryObj => {
    return fetch(`${process.env.REACT_APP_API_URL}/search`, {
        method: "GET",
        headers: {
            Accept: "Application/json",
            "Content-Type": "Application/json"
        },
        body: JSON.stringify(queryObj)
    })
    .then( res => {
        return res.json();
    })
    .catch( error => {
        console.log("ERROR POST ADD TAG");
    })
}
